function CartLine(props) {
    return(
        <div className="cart__line">
            <div className="cart__lineImage">

            </div>
            <div className="cart__lineMeta">
                <div className="cart__lineTitle">{ props.product.product.title }</div>
                <div className="cart__linePrice">{ props.product.product.price }</div>
                <div className="cart__lineVariant">{ props.product.size }</div>
                <div className="cart__lineVariant">{ props.product.color }</div>
            </div>
        </div>
    )
}

export default CartLine;
